import React from "react";
import "../styles/dashboard.css"
import {Link} from "react-router-dom";

function DashboardNavBar(){
    return(
        <div id="dash-navbar">
            <div className="dash-navbar-itemcontainers"><button>&#9776;</button></div>
            <div className="dash-navbar-itemcontainers"><img id="dash-logo" src="./images/virtual-version-log.png"></img></div>
            <div className="dash-navbar-itemcontainers"><Link to="/file"><button>New File</button></Link></div>
        </div>
    );
}

export default DashboardNavBar;
